    /**
     * Actualiza parcialmente los datos de un usuario.
     *
     * @param objUsuario
     * @throws java.lang.Exception
     *
     */
    @POST
    @Path("/put/usuario")
    @Consumes(MediaType.APPLICATION_JSON)
    public void putUsuario(Object objUsuario) throws Exception {
        Usuario usuario = new Usuario();
        try {
            usuario = (Usuario) UtilidadesGeneral.obtenerObjetoMapa(objUsuario, usuario);
            GestorUsuario gestorUsuario = new GestorUsuario();
            gestorUsuario.validarAtributos(usuario);
            usuario = gestorUsuario.upperAtributos(usuario);
            gestorUsuario.actualizarUsuario(usuario);
        } catch (Exception ex) {
            if (!UtilLog.causaControlada(ex)) {
                UtilLog.generarLog(Usuario.class, ex);
            }
            throw ex;
        }
    }

    /**
     * Crea un nuevo usuario.
     *
     * @param objUsuario
     * @return
     * @throws java.lang.Exception
     *
     */
    @POST
    @Path("/post/registrar/usuario")
    @Consumes(MediaType.APPLICATION_JSON)
    public Usuarios registrarUsuario(Object objUsuario) throws Exception {
        Usuarios usuarios = new Usuarios();

        try {
            usuarios = (Usuarios) UtilidadesGeneral.obtenerObjetoMapa(objUsuario, usuarios);
            GestorUsuario gestorUsuario = new GestorUsuario();
            gestorUsuario.validarAtributos(usuarios, Usuario.VERIFICAR_CLAVE);
//            usuario = gestorUsuario.upperAtributos(usuario);
            gestorUsuario.almacenarUsuario(usuarios);
            return usuarios;
        } catch (Exception ex) {
            if (!UtilLog.causaControlada(ex)) {
                UtilLog.generarLog(Usuario.class, ex);
            }
            throw ex;
        }
    }

    /**
     * Envia un correo electronico de contacto.
     *
     * @param nombre
     * @param correo
     * @param telefono
     * @param mensaje
     * @param asunto
     * @return
     * @throws java.io.IOException
     */
    @POST
    @Path("/post/correoAsunto")
    @Produces(MediaType.APPLICATION_JSON)
    public Response postCorreo(@FormParam("nombre") String nombre,
            @FormParam("correo") String correo, @FormParam("telefono") String telefono,
            @FormParam("mensaje") String mensaje) throws IOException {
        final String username = "oasys.scon@gmail.com";
        final String password = "@Contacto2016";
        final String asunto = "Nuevo Mensaje - " + nombre;

        if (!UtilCorreo.validarCorreo(correo)) {
            return Response.status(422)
                    .entity("El correo ingresado no tiene un formato correcto, no se puede continuar.")
                    .build();
        }

        Properties props = new Properties();
        props.put("mail.smtp.auth", "true");
        props.put("mail.smtp.starttls.enable", "true");
        props.put("mail.smtp.host", "smtp.gmail.com");
        props.put("mail.smtp.port", "587");

        Session session = Session.getInstance(props,
                new javax.mail.Authenticator() {
            protected PasswordAuthentication getPasswordAuthentication() {
                return new PasswordAuthentication(username, password);
            }
        });

        try {
//            String img = "data:image/png;base64,";

            String firma = "<div id='firma'>"
                    + "    <meta http-equiv='Content-Type' content='text/html; charset=UTF-8'>"
                    + "    <title>Firmas de oasys.com : OASYS.</title>"
                    + "    <style type='text/css'>"
                    + "        a {"
                    + "            color: #09C;"
                    + "            text-decoration: none;"
                    + "        }"
                    + "        a:hover {"
                    + "            color: #069;"
                    + "        }"
                    + "    </style>"
                    + "    <table width='100%' border='0' cellspacing='5' cellpadding='0'>"
                    + "        <tbody>"
                    + "            <tr>"
                    + "                <td align='left' valign='middle'>"
                    + "                    <p>"
                    + "                        <br/><font face='Trebuchet MS, Arial, Helvetica, sans-serif' color='#05233d' style='font-size:14px;'>Cordialmente</font><br/><br/>"
                    + "                        <font face='Trebuchet MS, Arial, Helvetica, sans-serif' color='#05233d' style='font-size:18px;'>" + nombre + "</font><br>    "
                    + "                        <font face='Trebuchet MS, Arial, Helvetica, sans-serif' color='#90a7b5'><em style='font-size:12px;'>" + telefono + "</em></font><br>"
                    + "                        <font face='Trebuchet MS, Arial, Helvetica, sans-serif' style='font-size:12px'>"
                    + "                        <a href='mailto:oasys.stec@gmail.com'>" + correo + "</a></font><br>"
                    + "                        <font face='Trebuchet MS, Arial, Helvetica, sans-serif' color='#1b4260' size='-1'>"
                    //                    + "                        <a href='http://ips-sinergiaco.rhcloud.com'>ips-sinergiaco.rhcloud.com</a></font>"
                    + "                    </p>"
                    + "                </td>"
                    + "            </tr>"
                    + "        </tbody>"
                    + "    </table>"
                    + "</div>";

            Message message = new MimeMessage(session);
            message.setFrom(new InternetAddress("oasys.scon@gmail.com"));

            new InternetAddress(correo).validate();

            message.setRecipients(Message.RecipientType.TO,
                    InternetAddress.parse(correo + ",sistesa@sistesasas.com,oasys.stec@gmail.com"));
            message.setReplyTo(InternetAddress.parse("oasys.stec@gmail.com"));
            message.setReplyTo(InternetAddress.parse("sistesa@sistesasas.com"));
            message.setSubject(asunto);
//            message.setText(mensaje + "," + "\n\nCordialmente.\n\n" + nombre + "\nContacto:" + telefono);
            mensaje += firma;
            message.setContent(mensaje, "text/html; charset=utf-8");
            Transport.send(message);

            System.out.println("Done");
            return Response.status(200)
                    .entity("En hora buena, tu inquietud fue enviada con copia a tu correo. Te responderemos en la mayor brevedad posible.")
                    .build();
        } catch (MessagingException e) {
            throw new RuntimeException(e);
        }
    }

